import { Link, useLocation, useHistory } from 'react-router-dom';

function View() {
    return (
        <section className="view">
            <Link to='classes' className="header__link">Аудитория</Link>
            <Link to='signup' className="header__link">Группа</Link>
            <Link to='signup' className="header__link">Преподаватель</Link>
        </section>
    );
}

export default View;
